  in Gulf of Maine werensubmitted by Dr. Charles Yentsch from Bigelow Laboratory for
  OceannSciences. The data was collected aboard several vessels (Atlantis,nCrawford,
  Bear, Chain, Knorr, Tioga, and Oceanographer) and in differentnsites over a period
  spanning from September 1956 to June 1982. Referencennumbers L00843 thru L00862
  represent the different cruises. Only date,nlatitude/longitude, depth, cruise, and
  chlorophyll (in mg/m3) are reported.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
